    "README.md": {
      "path": "README.md",
      "content": "# Chlorian MIDI Player\n\n[See it in Action!](https://danielx.net/chlorian/)\n\nBuilding a MIDI player using HTML5 audio because why not? It parses MIDI files\nand uses real SoundFonts to render the MIDI as audio using the Web Audio API.\n\n## Questions or Comments\n\nOpen an issue or [email me](mailto:yahivin@gmail.com).\n\n## Libraries Used\n\nI scavanged a lot of code from various sources with various modifications\n\n### jasmid\n\nhttps://github.com/gasman/jasmid\n\n\n### JavaScript SoundFont 2 Parser\n\nCopyright 2013-2015 imaya/GREE Inc and Colin Clark. Licensed under the MIT License.\n\nhttps://github.com/colinbdclark/sf2-parser\n\n\n### sf2synth.js\n\nCopyright (c) 2013 imaya / GREE Inc.\n\nhttps://github.com/gree/sf2synth.js\n",
      "mode": "100644",
      "type": "blob"
    },
    "TODO.md": {
      "path": "TODO.md",
      "content": "Sequencer\n---------\n\nVisualize Sequencer\n\nEdit sequencer patterns\n\nRecord sequencer events as MIDI\n\nHook up multiple sequencers\n\n\nMIDI Inupt\n----------\n\nRecord MIDI input into a pattern\n\nReplay MIDI patterns\n\nVisualize and edit patterns\n",
      "mode": "100644",
      "type": "blob"
    },
    "dom.coffee": {
      "path": "dom.coffee",
      "content": "module.exports = (consumeEvents, domState) ->\n  document.addEventListener \"visibilitychange\", (e) ->\n    if document.hidden\n      domState.lookahead = 1.25\n\n      consumeEvents()\n    else\n      domState.lookahead = 0.25\n\n  setInterval ->\n    consumeEvents()\n  , 4\n",
      "mode": "100644",
      "type": "blob"
    },
    "font_list.cson": {
      "path": "font_list.cson",
      "content": "ct4mgm: \"https://whimsy.space/danielx/data/bEKepHacjexwXm92b2GU_BTj2EYjaClrAaB2jWaescU\" # CT4MGM\nmgm1: \"https://s3.amazonaws.com/whimsyspace-databucket-1g3p6d9lcl6x1/danielx/data/3mPhpFf7ZNEfu_yRZKm-R0xWJd62hB98jv_sqik7voQ\" # 1mgm1\nyamaha: \"https://whimsy.space/danielx/data/VQHGLBy82AW4ZppTgItJm1IpquIF-042W3Ix3u7PQeQ\" # Yamaha XG\nroland: \"https://whimsy.space/danielx/data/2KPRQpAqB3Ghy1bgmuCcYklbUF0mCXs0zSXF6Gn967M\"\n# generalUser = \"https://s3.amazonaws.com/whimsyspace-databucket-1g3p6d9lcl6x1/danielx/data/AHJSlkhvZSukK9vyCYJUdiyoAjk1PQS1WidFT8jtuKg\" # 30+MB\n",
      "mode": "100644",
      "type": "blob"
    },
    "lib/drop.coffee": {
      "path": "lib/drop.coffee",
      "content": "module.exports = (element, handler) ->\n  cancel = (e) ->\n    e.preventDefault()\n    return false\n\n  element.addEventListener \"dragover\", cancel\n  element.addEventListener \"dragenter\", cancel\n  element.addEventListener \"drop\", (e) ->\n    e.preventDefault()\n    handler(e)\n    return false\n",
      "mode": "100644",
      "type": "blob"
    },
